om/maron47\n\nMusic \u0026 Arrange \u0026 MIX：D.watt（IOSYS）様\nhttps://twitter.com/wattchan\n\nIllust \u0026 Animation：ががめ 様\nhttps://twitter.com/utsugame\nIllust：しぐれうい\n\nMovie：鬼灯わらべ 様\n\nNarration：犬山たまき 様\n\nRecording Engineer：丸岡詩織(studio MSR) 様\n\nMastering Engineer：片田浩史(Sony Music Studios Tokyo) 様\n\n2022.5.25 RELEASE\n1st Album『まだ雨はやまない』収録曲\nhttps://madaame-shigureui.com/\n\n「粛聖!! ロリ神レクイエム☆ 」インスト音源\nhttps://www.dropbox.com/scl/fi/rvaqimfakx7rwqkxcgrwj/Inst.wav?rlkey=wbfxvpyz8d49a6prjqmht3thd\u0026dl=0\nCDに収録されているinstのため、この音源を用いた作品は自動的に収益化がオフになってしまいます！注意！\n歌ってみたい猛者はどうぞ\n\n・企業/営利目的での使用（動画、配布素材も含む）、企業の方で歌詞の変更を予定している方\n・楽曲に関するお問い合わせをしたい方\nは以下のメールアドレス宛にどうぞ！\n☞ madaame@incs-toenter.jp\n\n個人の方は常識の範囲内でのご利用でしたらお問い合わせはご無用です🙇‍♂️✨\n\n※政治的思想・内容を含む二次創作、二次利用は営利・非営利限らずNGです。\n\n¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨\n\nLonely ロリロリ神、降臨\n鐘を鳴らせばこの通り\nこれは救済のレクイエム\n\nせーのっ\n触ったら逮捕！（Ah！）極Chu♡ de 点呼！（Uh！）\nいちにーさんしー？（ごめんなさーい）\nハァ？( ﾟДﾟ) ごめんなさいが、聞こえなーい（え〜！）\n粛聖!! ロリ神レクイエム☆\n\n将来は　お前なんかに\n好かれたくない（ない！）\n泥水で　口を洗え\n法廷で　会おう？♡（ねっ）\nさぁ　おまわりさん\n連れて行って\n妄想しか取り柄のない\nかわいそな人\n\n（ういちゃん！ういちゃん！待ってよういちゃん！）\nその姿親に見せられますかぁ？\n（ういちゃん！ういちゃん！かわいいよォ〜！）\nわぁ、ありがとう。お疲れ様です〜＾＾\n\nロリロリ神、降臨（ずっきゅーん！）\nマジヤバ奴等に用心（ばっきゅーん！）\nまともじゃないなら　早く消えてください\nLovely ロリロリ神、降臨（ずっきゅーん！）\n鐘を鳴らせばこの通り（Yes！）\nとても優しくて　素敵なお兄ちゃん\n楽園でホラ　ねんねしな\n\n\n（ういちゃん・・・）\nほら。世の中には、こんなに気持ち悪い人たちが\n蔓延っているんですっ！\nみーんな、晒しageますよ。\n（ういちゃん・・・うい、こっち向いてェ〜〜〜）\n\n触ったら逮捕！（Ah！）極Chu♡ de 点呼！（Uh！）\nいちにーさんしー？（ごめんなさーい）\nハァ？( ﾟДﾟ) ごめんなさいが、聞こえなーい（え〜！）\n粛聖!! ロリ神レクイエム☆\n\n\nはぁーい、獄中にいるみなしゃァーん\n刑務所ファンミーティングのお時間でぇーす\nその、腐りきった耳をゴリゴリかっぽじって\nよぉーく聴いてくださいね\n\nざぁーこ　　（助かる〜ゥ）\nキモキモ　　（助かる〜ゥ）\nうるさい　　（助かる〜ゥ）\n黙ってもらっていいですか？\n嫌いです　　（助かる〜ゥ）\nかわいそ　　（助かる〜ゥ）\nだーさっ　よーわっ　みっともな〜！w\n\nどうしようもない　お兄ちゃんお姉ちゃん\nもう希望もない　ゴミだおめーら\n汚物消毒　１１０番\n固有結界　は・つ・ど・う♡\n\n粛聖☆ういビーーーーム（あぁぁあぁぁぁ〜〜〜）\nもういっちょ！ういビーーーーム（あぁぁあぁぁぁ〜〜〜）\nまだまだぁ！ういビーーーーム（あぁぁあぁぁぁ〜〜〜）\nういビーーーーム（あぁぁあぁぁぁ〜〜〜）\n\n\n怒りの日。聖なるインターネットに、血の雨が降り注いだ日。\n愚かなロリコンを骨の髄まで浄化する、一筋の光。\nそれが、ういビームなのである。\n\n「ういは、全てを赦します・・・」\n\n\n嗚呼　この世の醜さを\n集めて描いてみるよ\n真っ白なキャンバスが　穢れて泣いている\nLonely　振り向いた少女は\nそっと手を掴む・・・\n『楽園など無いから』\n\n\nおっきなお友達のみんなえ\nお前らが打ち込んでいる虚無には、何の意味があるの？\nねぇ、教えてよ。うい、ぜんぜぇーんわかんないんだ！\n\n\nロリロリ神、降臨（ずっきゅーん！）\nさよなら笑顔でバイバイ（ばっきゅーん！）\nピリオドをどうぞ　この手で押してあげゆ\nLovely ロリロリ神、降臨（ずっきゅーん！）\n鐘を鳴らせばこの通り（Yes！）\nとても優しくて　素敵なお兄ちゃん\n楽園でホラ　ねんねしな\nそれが救済のレクイエム\n\n\n触ったら逮捕！（Ah！）極Chu♡ de 点呼！（Uh！）\nいちにーさんしー？（ごめんなさーい）\nハァ？( ﾟДﾟ) ごめんなさいが、聞こえなーい（え〜！）\n粛聖!! ロリ神レクイエム☆\n\nほんっとーに、きもちわるい。"},"lengthSeconds":"274","ownerProfileUrl":"http://www.youtube.com/@ui_shig","externalChannelId":"UCt30jJgChL8qeT9VPadidSw","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"98838220","category":"Entertainment","publishDate":"2023-09-10T06:05:11-07:00","ownerChannelName":"しぐれうい","liveBroadcastDetails":{"isLiveNow" うぞ\n\n・企業/営利目的での使用（動画、配布素材も含む）、企業の方で歌詞の変更を予定している方\n・楽曲に関するお問い合わせをしたい方\nは以下のメールアドレス宛にどうぞ！\n☞ madaame@incs-toenter.jp\n\n個人の方は常識の範囲内でのご利用でしたらお問い合わせはご無用です🙇‍♂️✨\n\n※政治的思想・内容を含む二次創作、二次利用は営利・非営利限らずNGです。\n\n¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨\n\nLonely ロリロリ神、降臨\n鐘を鳴らせばこの通り\nこれは救済のレクイエム\n\nせーのっ\n触ったら逮捕！（Ah！）極Chu♡ de 点呼！（Uh！）\nいちにーさんしー？（ごめんなさーい）\nハァ？( ﾟДﾟ) ごめんなさいが、聞こえなーい（え〜！）\n粛聖!! ロリ神レクイエム☆\n\n将来は　お前なんかに\n好かれたくない（ない！）\n泥水で　口を洗え\n法廷で　会おう？♡（ねっ）\nさぁ　おまわりさん\n連れて行って\n妄想しか取り柄のない\nかわいそな人\n\n（ういちゃん！ういちゃん！待ってよういちゃん！）\nその姿親に見せられますかぁ？\n（ういちゃん！ういちゃん！かわいいよォ〜！）\nわぁ、ありがとう。お疲れ様です〜＾＾\n\nロリロリ神、降臨（ずっきゅーん！）\nマジヤバ奴等に用心（ばっきゅーん！）\nまともじゃないなら　早く消えてください\nLovely ロリロリ神、降臨（ずっきゅーん！）\n鐘を鳴らせばこの通り（Yes！）\nとても優しくて　素敵なお兄ちゃん\n楽園でホラ　ねんねしな\n\n\n（ういちゃん・・・）\nほら。世の中には、こんなに気持ち悪い人たちが\n蔓延っているんですっ！\nみーんな、晒しageますよ。\n（ういちゃん・・・うい、こっち向いてェ〜〜〜）\n\n触ったら逮捕！（Ah！）極Chu♡ de 点呼！（Uh！）\nいちにーさんしー？（ごめんなさーい）\nハァ？( ﾟДﾟ) ごめんなさいが、聞こえなーい（え〜！）\n粛聖!! ロリ神レクイエム☆\n\n\nはぁーい、獄中にいるみなしゃァーん\n刑務所ファンミーティングのお時間でぇーす\nその、腐りきった耳をゴリゴリかっぽじって\nよぉーく聴いてくださいね\n\nざぁーこ　　（助かる〜ゥ）\nキモキモ　　（助かる〜ゥ）\nうるさい　　（助かる〜ゥ）\n黙ってもらっていいですか？\n嫌いです　　（助かる〜ゥ）\nかわいそ　　（助かる〜ゥ）\nだーさっ　よーわっ　みっともな〜！w\n\nどうしようもない　お兄ちゃんお姉ちゃん\nもう希望もない　ゴミだおめーら\n汚物消毒　１１０番\n固有結界　は・つ・ど・う♡\n\n粛聖☆ういビーーーーム（あぁぁあぁぁぁ〜〜〜）\nもういっちょ！ういビーーーーム（あぁぁあぁぁぁ〜〜〜）\nまだまだぁ！ういビーーーーム（あぁぁあぁぁぁ〜〜〜）\nういビーーーーム（あぁぁあぁぁぁ〜〜〜）\n\n\n怒りの日。聖なるインターネットに、血の雨が降り注いだ日。\n愚かなロリコンを骨の髄まで浄化する、一筋の光。\nそれが、ういビームなのである。\n\n「ういは、全てを赦します・・・」\n\n\n嗚呼　この世の醜さを\n集めて描いてみるよ\n真っ白なキャンバスが　穢れて泣いている\nLonely　振り向いた少女は\nそっと手を掴む・・・\n『楽園など無いから』\n\n\nおっきなお友達のみんなえ\nお前らが打ち込んでいる虚無には、何の意味があるの？\nねぇ、教えてよ。うい、ぜんぜぇーんわかんないんだ！\n\n\nロリロリ神、降臨（ずっきゅーん！）\nさよなら笑顔でバイバイ（ばっきゅーん！）\nピリオドをどうぞ　この手で押してあげゆ\nLovely ロリロリ神、降臨（ずっきゅーん！）\n鐘を鳴らせばこの通り（Yes！）\nとても優しくて　素敵なお兄ちゃん\n楽園でホラ　ねんねしな\nそれが救済のレクイエム\n\n\n触ったら逮捕！（Ah！）極Chu♡ de 点呼！（Uh！）\nいちにーさんしー？（ごめんなさーい）\nハァ？( ﾟДﾟ) ごめんなさいが、聞こえなーい（え〜！）\n粛聖!! ロリ神レクイエム☆\n\nほんっとーに、きもちわるい。","commandRuns":[{"startIndex":36,"length":13,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBoQ040EGAMiEwistczhp9GGAxUbkMIBHafMCAFInKT1753t_JcK","commandMetadata":{"webCommandMe
